    SET first_name    = first_name_p,
        last_name     = last_name_p,
        birth_date    = birth_date_p,
        height        = height_p,
        jersey_number = jersey_number_p,
        is_active     = is_active_p,
        season_exp    = season_exp_p
    WHERE player_id = player_id_p;

